import React from 'react';

import images from '../../constants/images';
import './Intro.css';

const Intro = () => (
  <body>
    <div>
      <div className='card-collection'>
        <div className='bored'>
          <img src={images.bored} alt="bored" />
        </div>
        <h1 className='boredname'>Bored Ape Yacht Club</h1>
        <h2 className='wallet'>0x6080b4.s01993825...</h2>
      </div>
      <div className='trade-card'></div>
      <div className='trade-graphic'></div>
      <div className='list-title'></div>
      <div className='frame50'></div>
    </div>
  </body>
);

export default Intro;
